import React from 'react';
import { AppBar, Toolbar, Typography, Button, Box } from '@mui/material';
import { makeStyles } from '@mui/styles';
import { useNavigate, useParams } from 'react-router-dom';
import HealthAndSafetyIcon from '@mui/icons-material/HealthAndSafety';

const useStyles = makeStyles(() => ({
  root: {
    flexGrow: 1,
  },
  appBar: {
    backgroundColor: '#4051B5',
    color: '#fff',
  },
  title: {
    flexGrow: 1,
    fontWeight: 'bold',
    fontSize: '1.5rem',
    display: 'flex',
    alignItems: 'center',
  },
  icon: {
    marginRight: '10px',
  },
  button: {
    margin: '0 5px',
    backgroundColor: 'rgba(255,255,255,0.1)',
    color: '#fff',
    '&:hover': {
      backgroundColor: 'rgba(255,255,255,0.2)',
    },
    borderRadius: '5px',
    textTransform: 'none',
    fontWeight: 500,
    fontSize: '1rem'
  }
}));

const Navbar = () => {
  const classes = useStyles();
  const navigate = useNavigate();
  const { pid } = useParams();

  const handleLogout = () => {
    localStorage.removeItem('token');
    localStorage.removeItem('pid');
    navigate('/signin');
  };

  const handleHome = () => {
    if (pid) {
      navigate(`/home/${pid}`);
    } else {
      const storedPid = localStorage.getItem('pid');
      if (storedPid) {
        navigate(`/home/${storedPid}`);
      } else {
        navigate('/signin');
      }
    }
  };

  return (
    <div className={classes.root}>
      <AppBar position="static" className={classes.appBar} elevation={2}>
        <Toolbar>
          <Typography variant="h6" className={classes.title}>
            <HealthAndSafetyIcon className={classes.icon} /> 
            Teledermatology System
          </Typography>
          <Box>
            <Button className={classes.button} onClick={handleHome}>Home</Button>
            <Button className={classes.button} onClick={handleLogout}>Logout</Button>
          </Box>
        </Toolbar>
      </AppBar>
    </div>
  );
};

export default Navbar;
